css:
@-moz-document regexp("https://source.android.com/.*"), regexp("https://developer.android.com/.*") {
/* Dark Google Drive
   Author:   vaarai
   Based on: https://userstyles.org/styles/166089/android-developers-invert-dark
   Licence:  https://creativecommons.org/licenses/by-sa/4.0/
*/

:root {
    --bg-color-light: #282828;
    --bg-color: #222;
    --bg-color-dark: #161616;
    --invert: 85%;
}

/*-------- header --------*/
div.devsite-collapsible-section, div.devsite-top-logo-row-wrapper-wrapper {
     filter: invert(var(--invert));
}
header {
    background-color: var(--bg-color) !important;
}


/* LOGO */
devsite-header .devsite-product-name-link, devsite-header .devsite-site-logo-link {
    width: 130px;
    height: 32px;
    filter: invert(100%);
}
devsite-header .devsite-site-logo {
    visibility: hidden;
}


/*-------- body --------*/
/*---- header section bar ----*/
div.devsite-header-background,
body[theme=androidsource-theme] devsite-tabs.lower-tabs a,
body[theme=android-theme] devsite-tabs.lower-tabs a{
    background-color: #fff;
}
body[theme=android-theme] devsite-tabs.lower-tabs tab[active]>a::after,
body[theme=android-theme] devsite-tabs.upper-tabs>div>tab[active]>a::after,
body[theme=androidsource-theme] devsite-tabs.upper-tabs>div>tab[active]>a::after {
    background-color: #000;
}
body[theme=android-theme] devsite-toc>.devsite-nav-list,
body[theme=androidsource-theme] devsite-toc>.devsite-nav-list {
    border-color: #000;
}

/*---- side bar ----*/
div.devsite-book-nav-wrapper {
    filter: invert(100%);
}
devsite-book-nav {
    filter: invert(var(--invert));
}
div.devsite-book-nav-bg {
    background-color: var(--bg-color) !important;
}
ul.devsite-nav-list {
    filter: invert(var(--invert)); 
}
/*---- main body ----*/
body {
    background-color: var(--bg-color) !important;
}
devsite-content {
    filter: invert(var(--invert)); 
}

/*-------- footer --------*/
.devsite-footer {
    filter: invert(var(--invert));
}

/*-------- media --------*/
img, image, .video-wrapper, .video-wrapper-left, .video-wrapper-right {
    filter: invert(100%) contrast(125%) brightness(110%);
}
a.devsite-card-image-bg  {
    filter: invert(100%) contrast(125%) brightness(110%);
}
}

@-moz-document regexp("https://source.android.com/.*") {
/* LOGO */
devsite-header .devsite-product-name-link, devsite-header .devsite-site-logo-link {
	background-size: 95px 32px;
    background-repeat: no-repeat;
	background-image: url("data:image/svg+xml;base64,")
}
}

@-moz-document regexp("https://developer.android.com/.*") {
/* LOGO */
devsite-header .devsite-product-name-link, devsite-header .devsite-site-logo-link {
	background-size: 130px 32px;
    background-repeat: no-repeat;
	background-image: url("data:image/svg+xml;base64,")
}
}
